import React, { useState, useEffect } from 'react';
import { useSelector } from 'react-redux';
import { RootState } from '../store/store';
import { 
  Users, 
  Home, 
  MessageSquare, 
  Calendar, 
  TrendingUp,
  CheckCircle,
  AlertCircle,
  Clock,
  Eye,
  BarChart3,
  FileText,
  UserCheck,
  Building,
  MapPin,
  Phone,
  Mail,
  DollarSign
} from 'lucide-react';
import { getImageUrl } from '../services/config';

interface DashboardStats {
  todayListings: number;
  todayVisits: number;
  pendingVisits: number;
  activeListings: number;
  usersByRole: Array<{ role: string; count: string }>;
  recentActivity: Array<{
    type: string;
    description: string;
    timestamp: string;
    activity_type: string;
  }>;
  visitStats: {
    total_visits: string;
    scheduled_visits: string;
    completed_visits: string;
    cancelled_visits: string;
    interested_tenants: string;
    interested_owners: string;
    matches: string;
  };
  listingStats: {
    total_listings: string;
    active_listings: string;
    inactive_listings: string;
    avg_price: string;
    apartments: string;
    houses: string;
    rooms: string;
  };
  userStats: {
    total_users: string;
    tenants: string;
    owners: string;
    staff: string;
    admins: string;
    verified_users: string;
    pending_kyc: string;
  };
}

interface TodayListing {
  listing_id: string;
  title: string;
  location: string;
  price: number;
  bedrooms: number;
  bathrooms: number;
  property_type: string;
  owner_name: string;
  owner_phone: string;
  owner_email: string;
  primary_photo: string;
  visit_count: string;
  created_at: string;
}

interface TodayVisit {
  visit_id: string;
  listing_id: string;
  tenant_id: string;
  visit_datetime: string;
  status: string;
  listing_title: string;
  listing_location: string;
  listing_price: number;
  tenant_name: string;
  tenant_phone: string;
  tenant_email: string;
  owner_name: string;
  owner_phone: string;
  owner_email: string;
  listing_photo: string;
  visit_notes: string;
}

const StaffDashboardPage: React.FC = () => {
  const { user } = useSelector((state: RootState) => state.auth);
  const [stats, setStats] = useState<DashboardStats | null>(null);
  const [todayListings, setTodayListings] = useState<TodayListing[]>([]);
  const [todayVisits, setTodayVisits] = useState<TodayVisit[]>([]);
  const [loading, setLoading] = useState(true);
  const [activeTab, setActiveTab] = useState('overview');
  
  // Report states
  const [visitReportData, setVisitReportData] = useState<any[]>([]);
  const [userReportData, setUserReportData] = useState<any>(null);
  const [listingReportData, setListingReportData] = useState<any[]>([]);
  
  // Filter states
  const [visitFilters, setVisitFilters] = useState({
    dateFrom: '',
    dateTo: '',
    status: '',
    propertyType: ''
  });
  
  const [userFilters, setUserFilters] = useState({
    role: '',
    kycStatus: '',
    dateRange: '30'
  });
  
  const [listingFilters, setListingFilters] = useState({
    propertyType: '',
    priceRange: '',
    status: '',
    dateRange: '30'
  });

  useEffect(() => {
    fetchStaffData();
  }, []);

  const fetchStaffData = async () => {
    try {
      const token = localStorage.getItem('token');
      const headers = {
        'Authorization': `Bearer ${token}`,
        'Content-Type': 'application/json'
      };

      // Fetch dashboard stats
      const statsResponse = await fetch('http://localhost:5000/api/staff/dashboard-stats', { headers });
      const statsData = await statsResponse.json();
      setStats(statsData);

      // Fetch today's listings
      const listingsResponse = await fetch('http://localhost:5000/api/staff/today-listings', { headers });
      const listingsData = await listingsResponse.json();
      setTodayListings(listingsData.listings);

      // Fetch today's visits
      const visitsResponse = await fetch('http://localhost:5000/api/staff/today-visits', { headers });
      const visitsData = await visitsResponse.json();
      setTodayVisits(visitsData.visits);

      setLoading(false);
    } catch (error) {
      console.error('Error fetching staff data:', error);
      setLoading(false);
    }
  };

  const formatPrice = (price: number) => {
    return new Intl.NumberFormat('en-IN', {
      style: 'currency',
      currency: 'NPR',
      minimumFractionDigits: 0,
    }).format(price);
  };

  const formatDateTime = (dateTime: string) => {
    return new Date(dateTime).toLocaleString();
  };

  // Report functions
  const fetchVisitReport = async () => {
    try {
      const token = localStorage.getItem('token');
      const params = new URLSearchParams();
      if (visitFilters.dateFrom) params.append('date_from', visitFilters.dateFrom);
      if (visitFilters.dateTo) params.append('date_to', visitFilters.dateTo);
      if (visitFilters.status) params.append('status', visitFilters.status);
      if (visitFilters.propertyType) params.append('property_type', visitFilters.propertyType);

      const response = await fetch(`http://localhost:5000/api/staff/reports?${params.toString()}`, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        const data = await response.json();
        setVisitReportData(data.visitTrends || []);
      }
    } catch (error) {
      console.error('Error fetching visit report:', error);
    }
  };

  const fetchUserReport = async () => {
    try {
      const token = localStorage.getItem('token');
      const params = new URLSearchParams();
      if (userFilters.role) params.append('role', userFilters.role);
      if (userFilters.kycStatus) params.append('kyc_status', userFilters.kycStatus);
      params.append('period', userFilters.dateRange);

      const response = await fetch(`http://localhost:5000/api/staff/reports?${params.toString()}`, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        const data = await response.json();
        setUserReportData(data.userStats || {});
      }
    } catch (error) {
      console.error('Error fetching user report:', error);
    }
  };

  const fetchListingReport = async () => {
    try {
      const token = localStorage.getItem('token');
      const params = new URLSearchParams();
      if (listingFilters.propertyType) params.append('property_type', listingFilters.propertyType);
      if (listingFilters.priceRange) params.append('price_range', listingFilters.priceRange);
      if (listingFilters.status) params.append('status', listingFilters.status);
      params.append('period', listingFilters.dateRange);

      const response = await fetch(`http://localhost:5000/api/staff/reports?${params.toString()}`, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        const data = await response.json();
        setListingReportData(data.listingPerformance || []);
      }
    } catch (error) {
      console.error('Error fetching listing report:', error);
    }
  };

  // Export functions
  const exportReport = (type: string) => {
    let data: any[] = [];
    let filename = '';
    let headers: string[] = [];

    switch (type) {
      case 'visits':
        data = visitReportData;
        filename = 'visit_statistics.csv';
        headers = ['Date', 'Total Visits', 'Completed', 'Cancelled', 'Matches'];
        break;
      case 'users':
        data = [userReportData];
        filename = 'user_statistics.csv';
        headers = ['Total Users', 'Verified Users', 'Pending KYC', 'Active Users'];
        break;
      case 'listings':
        data = listingReportData;
        filename = 'listing_performance.csv';
        headers = ['Property', 'Location', 'Price', 'Total Visits', 'Interested Tenants', 'Matches'];
        break;
      default:
        return;
    }

    // Convert to CSV
    let csvContent = headers.join(',') + '\n';
    
    if (type === 'users') {
      csvContent += Object.values(data[0]).join(',') + '\n';
    } else {
      data.forEach(row => {
        if (type === 'visits') {
          csvContent += `${row.date},${row.total_visits},${row.completed_visits},${row.cancelled_visits},${row.matches}\n`;
        } else if (type === 'listings') {
          csvContent += `${row.title},${row.location},${row.price},${row.total_visits},${row.interested_tenants},${row.matches}\n`;
        }
      });
    }

    // Download CSV
    const blob = new Blob([csvContent], { type: 'text/csv;charset=utf-8;' });
    const link = document.createElement('a');
    const url = URL.createObjectURL(blob);
    link.setAttribute('href', url);
    link.setAttribute('download', filename);
    link.style.visibility = 'hidden';
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex justify-center items-center">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
      </div>
    );
  }

  if (!user || !['staff', 'admin'].includes(user.role)) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-center">
          <h1 className="text-2xl font-bold text-gray-900 mb-4">Access Denied</h1>
          <p className="text-gray-600">This dashboard is only for staff and admin users.</p>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <div className="bg-white shadow-sm border-b">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-6">
          <div className="flex items-center justify-between">
            <div>
              <h1 className="text-2xl font-bold text-gray-900">Staff Dashboard</h1>
              <p className="text-gray-600">Welcome back, {user?.full_name}</p>
            </div>
            <div className="flex items-center space-x-4">
              <span className="px-3 py-1 bg-blue-100 text-blue-800 text-sm font-medium rounded-full">
                {user.role === 'admin' ? 'Admin' : 'Staff'}
              </span>
              <button
                onClick={fetchStaffData}
                className="px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700 transition-colors"
              >
                Refresh Data
              </button>
            </div>
          </div>
        </div>
      </div>

      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        {/* Tabs */}
        <div className="mb-6">
          <nav className="flex space-x-8">
            <button
              onClick={() => setActiveTab('overview')}
              className={`py-2 px-1 border-b-2 font-medium text-sm ${
                activeTab === 'overview'
                  ? 'border-blue-500 text-blue-600'
                  : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
              }`}
            >
              Overview
            </button>
            <button
              onClick={() => setActiveTab('today')}
              className={`py-2 px-1 border-b-2 font-medium text-sm ${
                activeTab === 'today'
                  ? 'border-blue-500 text-blue-600'
                  : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
              }`}
            >
              Today's Activity
            </button>
            <button
              onClick={() => setActiveTab('visits')}
              className={`py-2 px-1 border-b-2 font-medium text-sm ${
                activeTab === 'visits'
                  ? 'border-blue-500 text-blue-600'
                  : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
              }`}
            >
              Visit Management
            </button>
            <button
              onClick={() => setActiveTab('reports')}
              className={`py-2 px-1 border-b-2 font-medium text-sm ${
                activeTab === 'reports'
                  ? 'border-blue-500 text-blue-600'
                  : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
              }`}
            >
              Reports & Analytics
            </button>
          </nav>
        </div>

        {/* Overview Tab */}
        {activeTab === 'overview' && stats && (
          <div className="space-y-8">
            {/* Key Stats Grid */}
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
              <div className="bg-white rounded-lg shadow-sm p-6">
                <div className="flex items-center">
                  <div className="p-2 bg-blue-100 rounded-lg">
                    <Home className="w-6 h-6 text-blue-600" />
                  </div>
                  <div className="ml-4">
                    <p className="text-sm font-medium text-gray-600">Today's Listings</p>
                    <p className="text-2xl font-bold text-gray-900">{stats.todayListings}</p>
                  </div>
                </div>
              </div>

              <div className="bg-white rounded-lg shadow-sm p-6">
                <div className="flex items-center">
                  <div className="p-2 bg-green-100 rounded-lg">
                    <Calendar className="w-6 h-6 text-green-600" />
                  </div>
                  <div className="ml-4">
                    <p className="text-sm font-medium text-gray-600">Today's Visits</p>
                    <p className="text-2xl font-bold text-gray-900">{stats.todayVisits}</p>
                  </div>
                </div>
              </div>

              <div className="bg-white rounded-lg shadow-sm p-6">
                <div className="flex items-center">
                  <div className="p-2 bg-yellow-100 rounded-lg">
                    <Clock className="w-6 h-6 text-yellow-600" />
                  </div>
                  <div className="ml-4">
                    <p className="text-sm font-medium text-gray-600">Pending Visits</p>
                    <p className="text-2xl font-bold text-gray-900">{stats.pendingVisits}</p>
                  </div>
                </div>
              </div>

              <div className="bg-white rounded-lg shadow-sm p-6">
                <div className="flex items-center">
                  <div className="p-2 bg-purple-100 rounded-lg">
                    <Building className="w-6 h-6 text-purple-600" />
                  </div>
                  <div className="ml-4">
                    <p className="text-sm font-medium text-gray-600">Active Listings</p>
                    <p className="text-2xl font-bold text-gray-900">{stats.activeListings}</p>
                  </div>
                </div>
              </div>
            </div>

            {/* Detailed Stats */}
            <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
              {/* Visit Statistics */}
              <div className="bg-white rounded-lg shadow-sm p-6">
                <h3 className="text-lg font-semibold text-gray-900 mb-4">Visit Statistics</h3>
                <div className="space-y-3">
                  <div className="flex justify-between">
                    <span className="text-gray-600">Total Visits</span>
                    <span className="font-medium">{stats.visitStats.total_visits}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Scheduled</span>
                    <span className="font-medium text-yellow-600">{stats.visitStats.scheduled_visits}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Completed</span>
                    <span className="font-medium text-green-600">{stats.visitStats.completed_visits}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Cancelled</span>
                    <span className="font-medium text-red-600">{stats.visitStats.cancelled_visits}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Matches</span>
                    <span className="font-medium text-blue-600">{stats.visitStats.matches}</span>
                  </div>
                </div>
              </div>

              {/* User Statistics */}
              <div className="bg-white rounded-lg shadow-sm p-6">
                <h3 className="text-lg font-semibold text-gray-900 mb-4">User Statistics</h3>
                <div className="space-y-3">
                  <div className="flex justify-between">
                    <span className="text-gray-600">Total Users</span>
                    <span className="font-medium">{stats.userStats.total_users}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Tenants</span>
                    <span className="font-medium text-blue-600">{stats.userStats.tenants}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Owners</span>
                    <span className="font-medium text-green-600">{stats.userStats.owners}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Verified</span>
                    <span className="font-medium text-purple-600">{stats.userStats.verified_users}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Pending KYC</span>
                    <span className="font-medium text-yellow-600">{stats.userStats.pending_kyc}</span>
                  </div>
                </div>
              </div>

              {/* Listing Statistics */}
              <div className="bg-white rounded-lg shadow-sm p-6">
                <h3 className="text-lg font-semibold text-gray-900 mb-4">Listing Statistics</h3>
                <div className="space-y-3">
                  <div className="flex justify-between">
                    <span className="text-gray-600">Total Listings</span>
                    <span className="font-medium">{stats.listingStats.total_listings}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Active</span>
                    <span className="font-medium text-green-600">{stats.listingStats.active_listings}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Avg Price</span>
                    <span className="font-medium">{formatPrice(parseFloat(stats.listingStats.avg_price) || 0)}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Apartments</span>
                    <span className="font-medium">{stats.listingStats.apartments}</span>
                  </div>
                  <div className="flex justify-between">
                    <span className="text-gray-600">Houses</span>
                    <span className="font-medium">{stats.listingStats.houses}</span>
                  </div>
                </div>
              </div>
            </div>

            {/* Recent Activity */}
            <div className="bg-white rounded-lg shadow-sm">
              <div className="px-6 py-4 border-b border-gray-200">
                <h2 className="text-lg font-semibold text-gray-900">Recent Activity</h2>
              </div>
              <div className="p-6">
                <div className="space-y-4">
                  {stats.recentActivity.slice(0, 10).map((activity, index) => (
                    <div key={index} className="flex items-center space-x-3">
                      <div className={`p-2 rounded-full ${
                        activity.activity_type === 'new_listing' ? 'bg-green-100' : 'bg-blue-100'
                      }`}>
                        {activity.activity_type === 'new_listing' ? (
                          <Home className="w-4 h-4 text-green-600" />
                        ) : (
                          <Calendar className="w-4 h-4 text-blue-600" />
                        )}
                      </div>
                      <div>
                        <p className="text-sm font-medium text-gray-900">{activity.description}</p>
                        <p className="text-xs text-gray-500">{formatDateTime(activity.timestamp)}</p>
                      </div>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          </div>
        )}

        {/* Today's Activity Tab */}
        {activeTab === 'today' && (
          <div className="space-y-8">
            {/* Today's Listings */}
            <div className="bg-white rounded-lg shadow-sm">
              <div className="px-6 py-4 border-b border-gray-200">
                <h2 className="text-lg font-semibold text-gray-900">Today's New Listings</h2>
              </div>
              <div className="p-6">
                {todayListings.length === 0 ? (
                  <p className="text-gray-500 text-center py-8">No new listings today</p>
                ) : (
                  <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                    {todayListings.map((listing) => (
                      <div key={listing.listing_id} className="border border-gray-200 rounded-lg p-4">
                        <div className="flex items-start space-x-4">
                          {listing.primary_photo && (
                            <img
                              src={getImageUrl(listing.primary_photo)}
                              alt={listing.title}
                              className="w-16 h-16 object-cover rounded-lg"
                            />
                          )}
                          <div className="flex-1">
                            <h3 className="font-medium text-gray-900">{listing.title}</h3>
                            <p className="text-sm text-gray-600 flex items-center">
                              <MapPin className="w-4 h-4 mr-1" />
                              {listing.location}
                            </p>
                            <p className="text-sm text-gray-600">{listing.bedrooms}BHK  {listing.property_type}</p>
                            <p className="text-lg font-semibold text-blue-600">{formatPrice(listing.price)}</p>
                            <div className="flex items-center justify-between mt-2">
                              <p className="text-xs text-gray-500">Owner: {listing.owner_name}</p>
                              <p className="text-xs text-gray-500">{listing.visit_count} visits</p>
                            </div>
                          </div>
                        </div>
                      </div>
                    ))}
                  </div>
                )}
              </div>
            </div>

            {/* Today's Visits */}
            <div className="bg-white rounded-lg shadow-sm">
              <div className="px-6 py-4 border-b border-gray-200">
                <h2 className="text-lg font-semibold text-gray-900">Today's Visits</h2>
              </div>
              <div className="p-6">
                {todayVisits.length === 0 ? (
                  <p className="text-gray-500 text-center py-8">No visits scheduled for today</p>
                ) : (
                  <div className="space-y-4">
                    {todayVisits.map((visit) => (
                      <div key={visit.visit_id} className="border border-gray-200 rounded-lg p-4">
                        <div className="flex items-start space-x-4">
                          {visit.listing_photo && (
                            <img
                              src={getImageUrl(visit.listing_photo)}
                              alt={visit.listing_title}
                              className="w-16 h-16 object-cover rounded-lg"
                            />
                          )}
                          <div className="flex-1">
                            <h3 className="font-medium text-gray-900">{visit.listing_title}</h3>
                            <p className="text-sm text-gray-600 flex items-center">
                              <MapPin className="w-4 h-4 mr-1" />
                              {visit.listing_location}
                            </p>
                            <p className="text-sm text-gray-600">
                              <Calendar className="w-4 h-4 mr-1 inline" />
                              {formatDateTime(visit.visit_datetime)}
                            </p>
                            <div className="flex items-center justify-between mt-2">
                              <div>
                                <p className="text-sm text-gray-600">Tenant: {visit.tenant_name}</p>
                                <p className="text-sm text-gray-600">Owner: {visit.owner_name}</p>
                              </div>
                              <span className={`px-2 py-1 text-xs rounded-full ${
                                visit.status === 'scheduled' ? 'bg-yellow-100 text-yellow-800' :
                                visit.status === 'completed' ? 'bg-green-100 text-green-800' :
                                'bg-red-100 text-red-800'
                              }`}>
                                {visit.status}
                              </span>
                            </div>
                            {visit.visit_notes && (
                              <p className="text-sm text-gray-500 mt-2 italic">"{visit.visit_notes}"</p>
                            )}
                          </div>
                        </div>
                      </div>
                    ))}
                  </div>
                )}
              </div>
            </div>
          </div>
        )}

        {/* Visit Management Tab */}
        {activeTab === 'visits' && (
          <div className="bg-white rounded-lg shadow-sm">
            <div className="px-6 py-4 border-b border-gray-200">
              <h2 className="text-lg font-semibold text-gray-900">Visit Management</h2>
            </div>
            <div className="p-6">
              <p className="text-gray-500 text-center py-8">Visit management features coming soon...</p>
            </div>
          </div>
        )}

        {/* Reports Tab */}
        {activeTab === 'reports' && (
          <div className="space-y-8">
            {/* Visit Statistics Report */}
            <div className="bg-white rounded-lg shadow-sm">
              <div className="px-6 py-4 border-b border-gray-200">
                <div className="flex items-center justify-between">
                  <h2 className="text-lg font-semibold text-gray-900">Visit Statistics Report</h2>
                  <button
                    onClick={() => exportReport('visits')}
                    className="px-4 py-2 bg-green-600 text-white rounded-md hover:bg-green-700 transition-colors"
                  >
                    Export CSV
                  </button>
                </div>
              </div>
              <div className="p-6">
                <div className="mb-6">
                  <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-1">Date From</label>
                      <input
                        type="date"
                        value={visitFilters.dateFrom}
                        onChange={(e) => setVisitFilters({...visitFilters, dateFrom: e.target.value})}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                      />
                    </div>
                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-1">Date To</label>
                      <input
                        type="date"
                        value={visitFilters.dateTo}
                        onChange={(e) => setVisitFilters({...visitFilters, dateTo: e.target.value})}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                      />
                    </div>
                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-1">Status</label>
                      <select
                        value={visitFilters.status}
                        onChange={(e) => setVisitFilters({...visitFilters, status: e.target.value})}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                      >
                        <option value="">All Statuses</option>
                        <option value="scheduled">Scheduled</option>
                        <option value="completed">Completed</option>
                        <option value="cancelled">Cancelled</option>
                      </select>
                    </div>
                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-1">Property Type</label>
                      <select
                        value={visitFilters.propertyType}
                        onChange={(e) => setVisitFilters({...visitFilters, propertyType: e.target.value})}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                      >
                        <option value="">All Types</option>
                        <option value="apartment">Apartment</option>
                        <option value="house">House</option>
                        <option value="room">Room</option>
                        <option value="studio">Studio</option>
                      </select>
                    </div>
                  </div>
                  <div className="mt-4 flex justify-end">
                    <button
                      onClick={() => fetchVisitReport()}
                      className="px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700 transition-colors"
                    >
                      Apply Filters
                    </button>
                  </div>
                </div>
                
                {visitReportData && (
                  <div className="overflow-x-auto">
                    <table className="min-w-full divide-y divide-gray-200">
                      <thead className="bg-gray-50">
                        <tr>
                          <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Date</th>
                          <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Total Visits</th>
                          <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Completed</th>
                          <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Cancelled</th>
                          <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Matches</th>
                        </tr>
                      </thead>
                      <tbody className="bg-white divide-y divide-gray-200">
                        {visitReportData.map((row, index) => (
                          <tr key={index}>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{row.date}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{row.total_visits}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-green-600">{row.completed_visits}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-red-600">{row.cancelled_visits}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-blue-600">{row.matches}</td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                )}
              </div>
            </div>

            {/* User Statistics Report */}
            <div className="bg-white rounded-lg shadow-sm">
              <div className="px-6 py-4 border-b border-gray-200">
                <div className="flex items-center justify-between">
                  <h2 className="text-lg font-semibold text-gray-900">User Statistics Report</h2>
                  <button
                    onClick={() => exportReport('users')}
                    className="px-4 py-2 bg-green-600 text-white rounded-md hover:bg-green-700 transition-colors"
                  >
                    Export CSV
                  </button>
                </div>
              </div>
              <div className="p-6">
                <div className="mb-6">
                  <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-1">Role</label>
                      <select
                        value={userFilters.role}
                        onChange={(e) => setUserFilters({...userFilters, role: e.target.value})}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                      >
                        <option value="">All Roles</option>
                        <option value="tenant">Tenant</option>
                        <option value="owner">Owner</option>
                        <option value="staff">Staff</option>
                        <option value="admin">Admin</option>
                      </select>
                    </div>
                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-1">KYC Status</label>
                      <select
                        value={userFilters.kycStatus}
                        onChange={(e) => setUserFilters({...userFilters, kycStatus: e.target.value})}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                      >
                        <option value="">All Statuses</option>
                        <option value="verified">Verified</option>
                        <option value="pending">Pending</option>
                        <option value="rejected">Rejected</option>
                      </select>
                    </div>
                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-1">Date Range</label>
                      <select
                        value={userFilters.dateRange}
                        onChange={(e) => setUserFilters({...userFilters, dateRange: e.target.value})}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                      >
                        <option value="7">Last 7 days</option>
                        <option value="30">Last 30 days</option>
                        <option value="90">Last 90 days</option>
                        <option value="365">Last year</option>
                      </select>
                    </div>
                  </div>
                  <div className="mt-4 flex justify-end">
                    <button
                      onClick={() => fetchUserReport()}
                      className="px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700 transition-colors"
                    >
                      Apply Filters
                    </button>
                  </div>
                </div>
                
                {userReportData && (
                  <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
                    <div className="bg-blue-50 p-4 rounded-lg">
                      <h3 className="text-lg font-semibold text-blue-900">Total Users</h3>
                      <p className="text-3xl font-bold text-blue-600">{userReportData.total_users}</p>
                    </div>
                    <div className="bg-green-50 p-4 rounded-lg">
                      <h3 className="text-lg font-semibold text-green-900">Verified Users</h3>
                      <p className="text-3xl font-bold text-green-600">{userReportData.verified_users}</p>
                    </div>
                    <div className="bg-yellow-50 p-4 rounded-lg">
                      <h3 className="text-lg font-semibold text-yellow-900">Pending KYC</h3>
                      <p className="text-3xl font-bold text-yellow-600">{userReportData.pending_kyc}</p>
                    </div>
                    <div className="bg-purple-50 p-4 rounded-lg">
                      <h3 className="text-lg font-semibold text-purple-900">Active Users</h3>
                      <p className="text-3xl font-bold text-purple-600">{userReportData.active_users}</p>
                    </div>
                  </div>
                )}
              </div>
            </div>

            {/* Listing Performance Report */}
            <div className="bg-white rounded-lg shadow-sm">
              <div className="px-6 py-4 border-b border-gray-200">
                <div className="flex items-center justify-between">
                  <h2 className="text-lg font-semibold text-gray-900">Listing Performance Report</h2>
                  <button
                    onClick={() => exportReport('listings')}
                    className="px-4 py-2 bg-green-600 text-white rounded-md hover:bg-green-700 transition-colors"
                  >
                    Export CSV
                  </button>
                </div>
              </div>
              <div className="p-6">
                <div className="mb-6">
                  <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-1">Property Type</label>
                      <select
                        value={listingFilters.propertyType}
                        onChange={(e) => setListingFilters({...listingFilters, propertyType: e.target.value})}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                      >
                        <option value="">All Types</option>
                        <option value="apartment">Apartment</option>
                        <option value="house">House</option>
                        <option value="room">Room</option>
                        <option value="studio">Studio</option>
                      </select>
                    </div>
                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-1">Price Range</label>
                      <select
                        value={listingFilters.priceRange}
                        onChange={(e) => setListingFilters({...listingFilters, priceRange: e.target.value})}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                      >
                        <option value="">All Prices</option>
                        <option value="0-10000">0 - 10,000</option>
                        <option value="10000-25000">10,000 - 25,000</option>
                        <option value="25000-50000">25,000 - 50,000</option>
                        <option value="50000+">50,000+</option>
                      </select>
                    </div>
                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-1">Status</label>
                      <select
                        value={listingFilters.status}
                        onChange={(e) => setListingFilters({...listingFilters, status: e.target.value})}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                      >
                        <option value="">All Statuses</option>
                        <option value="active">Active</option>
                        <option value="inactive">Inactive</option>
                      </select>
                    </div>
                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-1">Date Range</label>
                      <select
                        value={listingFilters.dateRange}
                        onChange={(e) => setListingFilters({...listingFilters, dateRange: e.target.value})}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
                      >
                        <option value="7">Last 7 days</option>
                        <option value="30">Last 30 days</option>
                        <option value="90">Last 90 days</option>
                        <option value="365">Last year</option>
                      </select>
                    </div>
                  </div>
                  <div className="mt-4 flex justify-end">
                    <button
                      onClick={() => fetchListingReport()}
                      className="px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700 transition-colors"
                    >
                      Apply Filters
                    </button>
                  </div>
                </div>
                
                {listingReportData && (
                  <div className="overflow-x-auto">
                    <table className="min-w-full divide-y divide-gray-200">
                      <thead className="bg-gray-50">
                        <tr>
                          <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Property</th>
                          <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Location</th>
                          <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Price</th>
                          <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Total Visits</th>
                          <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Interested Tenants</th>
                          <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Matches</th>
                        </tr>
                      </thead>
                      <tbody className="bg-white divide-y divide-gray-200">
                        {listingReportData.map((listing, index) => (
                          <tr key={index}>
                            <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">{listing.title}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{listing.location}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{listing.price}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{listing.total_visits}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-green-600">{listing.interested_tenants}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-blue-600">{listing.matches}</td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                )}
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default StaffDashboardPage;
